import React from "react";
import { Drawer, AppBar, Toolbar } from "@material-ui/core";
import { makeStyles, Typography } from "@material-ui/core";
import { List, ListItem, ListItemIcon, ListItemText } from "@material-ui/core";
import { NavBarItems } from "./NavBarItems";
import logo from "./logo.png";
import { useHistory } from "react-router-dom";

const drawerWidth = "230px";

export const styles = makeStyles({
  page: {
    background: "light grey",
    width: "100%",
  },

  drawer: {
    width: drawerWidth,
  },

  paper: {
    width: drawerWidth,
  },

  root: {
    display: "flex",
  },

  icons: {
    flex: "30%",
    display: "grid",
    placeItems: "center",
  },

  titles: {
    flex: "70%",
    fontFamily: "Noto Sans, sans-serif",
  },

  logo: {
    width: "60%",
  },
});

function NavBar() {
  const classes = styles();
  const history = useHistory();

  return (
    <div className={classes.root}>
      <AppBar>
        <Toolbar colour="secondary"></Toolbar>
      </AppBar>

      <Drawer
        className={classes.drawer}
        variant="permanent"
        anchor="left"
        classes={{ paper: classes.paper }}
      >
        <div style={{ height: "70px" }} align="center">
          <img src={logo} className={classes.logo} />
        </div>
        <div className={classes.toolbar} />
        <List>
          {NavBarItems.map((val, key) => (
            <ListItem 
            button 
            key={key}
            onClick={() => history.push(val.path)}
            >
              <ListItemIcon className={classes.icons}>{val.icon}</ListItemIcon>
              <ListItemText className={classes.titles} primary={val.title} />
            </ListItem>
          ))}
        </List>
      </Drawer>
    </div>
  );
}

export default NavBar;
